if(preg_match("/[cl]/i", $str)) {
  echo "есть c и l в пути\n";
  exit;
}

preg_match_all("/(m\s?[\d\.\,\s\-e]+\s?z)/", $str, $contours);

$out = "";
$lonStart = 0;
$latStart = 0;

var_dump($contours);

foreach($contours[1] as $contour) {
  $tmp = preg_replace("/^m\s?(.+)/", "$1", $contour);
  $tmp = preg_replace("/(.+)\s?z$/", "$1", $tmp);
  $tmp = trim($tmp);

  $arr = explode(" ", $tmp);
  list($lonC, $latC) = explode(",",$arr[0]);

  $lonC = floatval($lonC) + $lonStart;
  $lonStart = $lonC;

  $latC = floatval($latC) + $latStart;
  $latStart = $latC;

  $out .= "M".$lonC.",".$latC;

  for($i=1;$i<count($arr); $i++) {
    //if(! $arr[$i]) {
      //echo $i." ".$arr[$i-1]."\n";
    //}
    list($lonN, $latN) = explode(",",$arr[$i]);
    $lonC += floatval($lonN);
    $latC += floatval($latN);
    $out .= "L".$lonC.",".$latC;
  }
  $out .= "z";
}

echo $out."\n";
 

